import { DISCONECT } from "./chatApp.const"

const initialState = {
    disconect: 0
}

export const ChatAppReducer = (state = initialState, { type, payload }) => {
    switch (type) {
        case DISCONECT: {
            console.log(payload.data);
            state.disconect = payload.data
            return { ...state, ...payload }
        }
        default:
            return state
    }
}
